"use es6";

import React from "react";
import stars from "../images/stars.png";
import stripes from "../images/stripes.png";
import * as d3 from "d3";

const HomePage = () => {
  const canvasstyle = {
    width: "fit-content",
    height: "fit-content",
  };

  const starsstyle = {
    backgroundColor: "#000077",
    width: "fit-content",
    height: "fit-content",
  };

  const stripesstyle = {
    backgroundColor: "#770000",
    width: "fit-content",
    height: "fit-content",
  };

  var svgContainer = d3
    .select("#canvas")
    .append("svg")
    .attr("align", "center")
    .attr("width", 1105)
    .attr("height", 700);

  const x = 100;
  const y = 100;
  var star = svgContainer
    .append("polygon")
    .attr("fill", `#ffdf00`)
    .attr(
      "points",
      `${x},${y} ${x + 40},${y + 40} ${x + 80},${y} ${x + 40},${y - 40}`
    );

  return (
    <>
      <div>
        <h1>HOME</h1>
        <div id="canvas" style={canvasstyle}></div>
        {/* <div style={starsstyle}>
          <img src={stars} alt={"stars"} />
        </div>
        <div style={stripesstyle}>
          <img src={stripes} alt={"stripes"} />
        </div> */}
      </div>
    </>
  );
};

export default HomePage;
